import React from 'react'
import style from 'styled-components';

const LandingTitle = style.h1`

  color: white;
  margin: 0;
  font-size: 96px;

`;
const LandingSub = style.h1`

  color: #F0C453;
  margin: 0;
  font-size: 96px;

`;

const TitleWrapper = style.div`

  background-color: #232323;
  width: 100vw;
  height: 100vh;
  margin-left: 98px;
  margin-top: 79px;

`;

const Wrapper = style.div`

    display: flex;

`;

export default function Landing() {
    return (
        <TitleWrapper>
            <LandingTitle>
                The Shoppies
            </LandingTitle>
            <LandingSub>
                Everyone's<br/>
                A Critic
            </LandingSub>
        </TitleWrapper>
    )
}
